import './HeadBar.css';
import logo from '../img/Logo.png';
import { Col, Row, Container} from "react-bootstrap";


function HeadBar() {
  return (
    <Container>
    <Row>
      <Col sm={8} className="logoBrand">
        <img src={logo} alt="logo"></img>
      </Col>
      <Col sm={4}>2 of 2</Col>
    </Row>
    <Row>
      <Col>1 of 3</Col>
      <Col>2 of 3</Col>
      <Col>3 of 3</Col>
    </Row>
  </Container>    
          
  );
}

export default HeadBar;
